import React from 'react';

const Navbar = ({ onHome, onHistory, onChat }) => (
  <nav style={{ padding: '10px', background: '#eee', marginBottom: '20px', display: 'flex', gap: '10px' }}>
    <button onClick={onHome}>Home</button>
    <button onClick={onHistory}>History Chat</button>
    <button onClick={onChat}>Chat with Gemini</button>
  </nav>
);

export default Navbar;
